#Please Load the Dataframe here


import pandas
url = "https://raw.githubusercontent.com/Shiroyasha95/ICXRawData/main/Info%20intervals%202021-2023(1).csv"
data = pandas.read_csv(url)
print(data)

"""# 2.Data Parse and Analysis

Perform the neccesary data parsing and cleanup to achieve the following Tasks:

1.   Calculate the Average Volume of Calls by Year, Date and Interval of the [IB Calls] and [IB Handled], Display the Results of January 2023 in a timeline series Chart.

2.   Calculate the Service Level Compliance with the following Formula:
     Sum of Total [Calls in SL] / Sum of Total [IB Calls].
      
  *   Display the Results in a Scatter Plot Chart for the Dates of September 2022
  *   Display a Chart to compare the Calls Volume vs service Level for the month of September 2022

3.   Calculate the weighted [IB AHT] per month for 2021 and display the results in a dataframe and chart of your choice.

Add any Code/Text Cells needed to complete the Test below this Section.

"""

import matplotlib.pyplot as plt
# Task 1: Calculate Average Volume of Calls by Year, Date, and Interval
data['Date'] = pd.to_datetime(data['Date'])
data['Year'] = data['Date'].dt.year
average_volume = data.groupby(['Year', 'Date', 'Interval'])[['IB Calls', 'IB Handled']].mean().reset_index()

# Filter for January 2023
january_2023 = average_volume[(average_volume['Year'] == 2023) & (average_volume['Date'].dt.month == 1)]

# Create a timeline series chart
plt.figure(figsize=(12, 6))
plt.plot(january_2023['Date'], january_2023['IB Calls'], label='IB Calls')
plt.plot(january_2023['Date'], january_2023['IB Handled'], label='IB Handled')
plt.xlabel('Date')
plt.ylabel('Average Volume')
plt.title('Average Volume of Calls in January 2023')
plt.legend()
plt.grid()
plt.show()

# Task 2: Calculate Service Level Compliance
september_2022 = data[(data['Date'].dt.year == 2022) & (data['Date'].dt.month == 9)]

# Calculate Service Level Compliance
service_level_compliance = september_2022['Calls in SL'].sum() / september_2022['IB Calls'].sum()

# Create a scatter plot chart
plt.figure(figsize=(8, 6))
plt.scatter(september_2022['Date'], september_2022['Calls in SL'], label='Calls in SL')
plt.scatter(september_2022['Date'], september_2022['IB Calls'], label='IB Calls')
plt.xlabel('Date')
plt.ylabel('Volume')
plt.title(f'Service Level Compliance for September 2022: {service_level_compliance:.2%}')
plt.legend()
plt.grid()
plt.show()

# Task 3: Calculate Weighted IB AHT per Month for 2021
data['Date'] = pd.to_datetime(data['Date'])
data['Year'] = data['Date'].dt.year
data['Month'] = data['Date'].dt.month

# Filter for 2021
ib_aht_2021 = data[data['Year'] == 2021]

# Calculate weighted IB AHT per month
ib_aht_2021['Weighted IB AHT'] = ib_aht_2021['IB Calls'] * ib_aht_2021['IB AHT']
monthly_ib_aht = ib_aht_2021.groupby(['Year', 'Month'])['Weighted IB AHT'].sum().reset_index()

# Create a DataFrame to display the results
print(monthly_ib_aht)

# Create a chart to visualize the results (e.g., a bar plot)
plt.figure(figsize=(10, 6))
plt.bar(monthly_ib_aht['Month'], monthly_ib_aht['Weighted IB AHT'])
plt.xlabel('Month')
plt.ylabel('Weighted IB AHT')
plt.title('Weighted IB AHT per Month in 2021')
plt.xticks(monthly_ib_aht['Month'])
plt.grid()
plt.show()